import React from "react";
import { View, Text } from "react-native";


const UserProfile = () =>{
    return(
        <View>
            <Text style={{
                flex: 1, justifyContent: 'center', alignItems: 'center'}}>
                Cuenta
            </Text>
        </View>
    )
}

export default UserProfile;
